import React, { Component } from "react";

import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <h1>Test</h1>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}


for(var i = 0; i < data.length; i++) {
  var obj = json[i];

  console.log('ID: ' + obj.id);
}
